import ReactDOM from 'react-dom/client';

import Xd from './Xd';

function dic(){
    return(
        <div>
            aaa
        </div>
    );
}

const Xdcalamviec = () => {
    const root = ReactDOM.createRoot(document.getElementById('root1'));
    const root2 = ReactDOM.createRoot(document.getElementById('root2'));
        root.render(
                <Xd/>
        );
        root2.render(
            <dic/>
    )
}



export default Xdcalamviec;
